import logo from './images/logo.jpg'


const links = [{title:'Кто мы?',href:'#WhoUs'},{title:'Чем занимаемся?', href:'#WhatWeDo'},{title:'Наши планы', href:'#bebra'},
    {title:'Последние события', href:'#'},{title:'Обратная связь', href:'#'}]

function lst_menu(obj) { 
    return (
    <a key={obj.title} href={obj.href} className='font-sans text-justify  text-white 
    mx-2 text-sm h-16 py-2
    lg:mx-6 lg:my-3 lg:text-2xl lg:font-bold
'>
    
        {obj.title}</a>
)};

export default function Header(){
        
    return (
        <header className='flex w-full bg-blue-500 justify-center

        lg:h-46 lg:py-4 '>
            <img className='top-7 text-white text-2xl font-semibold 
            hidden
            lg:h-16'
             src={logo} alt='лого'></img>
            {links.map(el => lst_menu(el))}
        </header>
    )
}
